	add("veranda", "{\"term\":\"veranda\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Hindi\", \"Portuguese\"], \"text\":\"From Hindi {{l|hi|बरामदा|g\u003dm|tr\u003dbarāmdā}} or {{l|hi|बरण्डा|g\u003dm|tr\u003dbaraṇḍā}}, from Portuguese \u0027varanda\u0027 (balustrade; balcony) (Spanish \u0027baranda\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A gallery, platform, or balcony, usually roofed and often partly enclosed, extending along the outside of a building\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d4|passage\u003dNo matter how early I came down, I would find him on the \u0027\u0027veranda\u0027\u0027, smoking cigarettes, or otherwise his man would be there with a message to say that his master would shortly join me if I would kindly wait\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"title\u003dCrime out of chapter\u003d7|url\u003dhttp://openlibrary.org/works/OL5915292W|passage\u003dOur part of the \u0027\u0027veranda\u0027\u0027 did not hang over the gorge, but edged the meadow where half a dozen large and sleek horses had stopped grazing to join us\", \"priority\":3}]}, \"synonyms\":{}}");

	add("veratridine", "{\"term\":\"veratridine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of a family of neurotoxic steroid-derived alkaloids, occurring in herbs of the genus \u0027Veratrum\u0027 and seeds of the sabadilla plant\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1990\u0027\u0027, Dietrich Mebs, Ferdinand Mucho, \u00277: Toxins Acting on Ion Channels and Synapses\u0027, W. T. Shier (editor), \u0027Handbook of Toxinology\u0027, [https://books.google.com.au/books?id\u003d6oUdkb1hUCYC\u0026amp;pg\u003dPA513\u0026amp;dq\u003d%22veratridine%22%7C%22veratridines%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dksRZVaHlLcGsmAWQ2YHgBw\u0026amp;ved\u003d0CB8Q6AEwA\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22veratridine%22%7C%22veratridines%22\u0026amp;f\u003dfalse page 513\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Like batrachotoxin and \u0027\u0027veratridine\u0027\u0027, grayanotoxins act at the voltage-dependent sodium channel in its open conformation, inhibiting its inactivation\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Thomas D. White, \u0027The Demonstration and Measurement of Adenosine Triphosphate Release from Nerves\u0027, David Paton (editor), \u0027Methods in Pharmacology\u0027, Volume 6: Methods Used in Adenosine Research, [https://books.google.com.au/books?id\u003dkqfhBwAAQBAJ\u0026amp;pg\u003dPA47\u0026amp;dq\u003d%22veratridine%22%7C%22veratridines%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dksRZVaHlLcGsmAWQ2YHgBw\u0026amp;ved\u003d0CE8Q6AEwC\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22veratridine%22%7C%22veratridines%22\u0026amp;f\u003dfalse page 47\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The veratrum alkaloid, \u0027\u0027veratridine\u0027\u0027, depolarizes excitable tissues by activating the Na\u0026lt;sup\u0026gt;+\u0026lt;/sup\u0026gt; channels present in the cell membranes. Therefore, one would expect \u0027\u0027veratridine\u0027\u0027 to produce a depolarization of nerve that is quite similar to physiological depolarization insofar as it is mediated by changes in Na\u0026lt;sup\u0026gt;+\u0026lt;/sup\u0026gt; conductances\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Domingo M. Aviado, \u0027The Lung Circulation\u0027, Volume 1: Physiology and Pharmacology, [https://books.google.com.au/books?id\u003dnQclBQAAQBAJ\u0026amp;pg\u003dPA39\u0026amp;dq\u003d%22veratridine%22%7C%22veratridines%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dksRZVaHlLcGsmAWQ2YHgBw\u0026amp;ved\u003d0CGMQ6AEwD\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22veratridine%22%7C%22veratridines%22\u0026amp;f\u003dfalse page 39\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The results from \u0027\u0027veratridine\u0027\u0027 will be described first because they illustrate the ultimate way of obtaining proof that the carotid sinus baroreceptors can respond to foreign chemical agents\", \"priority\":10}]}, \"synonyms\":{}}");

	add("veratrin", "{\"term\":\"veratrin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A poisonous alkaloidal mixture obtained from sabadilla. It is an irritant, stimulant, and heart depressant, and produces violent sneezing: used, for the most part, externally as a counterirritant in neuralgia and rheumatism, in the form of an ointment\", \"priority\":1}]}, \"synonyms\":{}}");

