	add("verbality", "{\"term\":\"verbality\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|verbal|ity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or characteristic of consisting of words; that which consists simply of verbiage\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1914\u0027\u0027, w:F. C. S. F. C. S. Schiller, \u0026quot;Dr. Mercier and Formal Logic,\u0026quot; \u0027Mind\u0027, New Series, vol. 23, no. 92, p. 568\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"For my own investigations of traditional logic lead irresistably to the conclusion that it is essentially an equivocation between psychology and \u0027\u0027verbality\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1989\u0027\u0027, A. Kibédi Varga, \u0026quot;Criteria for Describing Word-and-Image Relations,\u0026quot; \u0027Poetics Today\u0027, vol. 10, no. 1, p. 37\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"In other words, to read a visual poem is to betray it; to restore it to \u0027\u0027verbality\u0027\u0027 is to eliminate half of its meaning\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Proficiency or fluency in the use of words\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1966\u0027\u0027, Shirley S. Angrist, \u0026quot;Communication about Birth Control: An Exploratory Study of Freshman Girls\u0027 Information and Attitudes,\u0026quot; \u0027Journal of Marriage and Family\u0027, vol. 28, no. 3, p. 285\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Generally, high communicators were found to be: college majors in humanities or natural sciences, Jewish or Catholic persons, first-born or only children, and those high in \u0027\u0027verbality\", \"priority\":8}]}, \"synonyms\":{}}");

