	add("verbena", "{\"term\":\"verbena\", \"etymology\":{\"influencers\":[], \"languages\":[\"Danish\", \"German\", \"middle dutch (ca. 1050-1350)\", \"English\", \"middle low german\", \"Latin\", \"Swedish\"], \"text\":\"From Latin \u0027verbena\u0027 (leaves or twigs of olive, myrtle, laurel, or other sacred plants employed in religious ceremonies) from Proto-indo-european {{m|ine-pro|*werbh}} (see also Lithuanian \u0027virbas\u0027 (twig, branch, scion, rod) , from Proto-indo-european {{m|ine-pro|*werb-||to turn, bend}}. Cognate with Middle dutch (ca. 1050-1350) \u0027warp\u0027 Middle low german \u0027warp\u0027 German \u0027warf\u0027 Danish \u0027varp\u0027 Swedish \u0027varp\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Verbena\u0027, a genus of herbaceous plants of which several species are extensively cultivated for the great beauty of their flowers; vervain\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1918\u0027\u0027, \u0027Prelude\u0027 (Selected Stories, Oxford World\u0027s Classics paperback 2002, 116\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Linda pulled a piece of \u0027\u0027verbena\u0027\u0027 and crumpled it, and held her hands to her mother\", \"priority\":3}]}, \"synonyms\":{}}");

