	add("vermilion", "{\"term\":\"vermilion\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027vermeillon\u0027 (vermilion) from \u0027vermeil\u0027 from Latin \u0027lang\u003dla|vermiculus\u0027 () from \u0027lang\u003dla|vermis\u0027 () ultimately in reference to {{taxlink|Kermes vermilio|species|noshow\u003d1}}, a type of scale insect used to make a crimson dye.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A vivid red synthetic pigment made of mercury sulfide\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A vivid red or slightly orange colour\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A type of red dye worn in the parting of the hair by married Hindu women\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A red skin of the lip or its border with the skin of the face\", \"priority\":4}]}, \"synonyms\":{}}");

