	add("vernacular", "{\"term\":\"vernacular\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027vernāculus\u0027 (domestic, indigenous, of or pertaining to home-born slaves) from \u0027verna\u0027 (a native, a home-born slave (one born in his master\u0027s house))\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The language of a people or a national language\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027vernacular\u0027\u0027 of the United States is English\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Everyday speech or dialect, including colloquialisms, as opposed to literary, liturgical, or scientific language\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Street \u0027\u0027vernacular\u0027\u0027 can be quite different from what is heard elsewhere\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Language unique to a particular group of people; jargon, argot\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"For those of a certain age, hiphop \u0027\u0027vernacular\u0027\u0027 might just as well be a foreign language\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The indigenous language of a people, into which the words of the Mass are translated\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Vatican II allowed the celebration of the mass in the \u0027\u0027vernacular\", \"priority\":8}]}, \"synonyms\":{}}");

	add("vernine", "{\"term\":\"vernine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|vernal|ine|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An alkaloid extracted from the shoots of the vetch, red clover, etc., as a white crystalline substance\", \"priority\":1}]}, \"synonyms\":{}}");

	add("vernissage", "{\"term\":\"vernissage\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027vernissage\u0027 derived from the earlier habit of the artists to varnish their paintings the day before the opening of an exhibition.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A private viewing of an art exhibition before it opens to the public\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1893\u0027\u0027: the artists\u0027 association will be forced to advance or delay its \u0027vernissage\u0027 and opening day. — \u0027The Times\u0027, 2 May 1893, p.5 col. C\", \"priority\":2}]}, \"synonyms\":{}}");

	add("vernix", "{\"term\":\"vernix\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\"], \"text\":\"From \u0027vernix\u0027 (varnish)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"vernix Vernix caseosa; a fatty deposit covering the skin of newborn babies\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Armin A Brott, \u0027The New Father\u0027, Mitchell Beazley 2011, p. 21\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The cheesy stuff is called \u0027\u0027vernix\u0027\u0027, and it\u0027s a natural moisturizer that protects the baby\u0027s skin while she\u0027s in the womb\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Sam Leith, \u0027The Guardian\u0027, 7 Nov 2009\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"But when – like Troy in the end of the film – you are presented for the first time with an angry, purple, bloody, \u0027\u0027vernix\u0027\u0027-covered, shit-smeared, breathing human being, everything changes\", \"priority\":5}]}, \"synonyms\":{}}");

	add("vernon", "{\"term\":\"vernon\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"anglo-norman\", \"transalpine gaulish\"], \"text\":\"An Anglo-norman baronial surname derived from place names in Normandy, from Transalpine gaulish \u0027ver(n)\u0027 \u0026quot;alder\u0026quot; + \u0027-o, -onis\u0027 (a locative suffix), hence \u0026quot;place of alder trees\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"transferred from the surname since the nineteenth century\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A city in British Columbia, Canada\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A city in Alabama\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A city in California\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A CDP in Colorado\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A town in Connecticut\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A city in Florida\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A village in Illinois\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A town in Indiana\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A village in Michigan\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A town and village in New York\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"An unincorporated community in Oklahoma\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A city in Texas\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A town in Utah\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A town in Vermont\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"A town in Wisconsin\", \"priority\":16}]}, \"synonyms\":{}}");

	add("verona", "{\"term\":\"verona\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Italian\", \"Latin\"], \"text\":\"From the Italian \u0027verona\u0027 and the Latin \u0027vērōna\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A straddling the river in , northern , and the city of the of the same name\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1591–5\u0027\u0027, \u0027w:Romeo and The Tragedy of Romeo and Juliet\u0027 (1623), s:The Tragedy of Romeo and Julie\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"\u0026lt;span style\u003d\u0026quot;font-variant:small-caps\u0026quot;\u0026gt;Prologue\u0026lt;/span\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Two households, both alike in dignity, // In fair \u0027\u0027Verona\u0027\u0027, where we lay our scene, // From ancient grudge break to new mutiny, // Where civil blood makes civil hands unclean\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A province in the Veneto of northern Italy\", \"priority\":5}]}, \"synonyms\":{}}");

	add("veronal", "{\"term\":\"veronal\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A barbiturate, diethylmalonyl urea or diethylbarbituric acid; barbitol, used formerly to induce sleep\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1919\u0027\u0027, w:William Somerset W. Somerset Maugham, \u0027w:The Moon and The Moon and Sixpence\u0027, s:The Moon and Sixpence/Chapter chapter 2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He was by now so worn out that he could not resist my firmness. I gave him a sufficient dose of \u0027\u0027veronal\u0027\u0027 to insure his unconsciousness for several hours. I thought that was the best service I could render him\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1926\u0027\u0027, Agatha Christie, \u0027The Murder of Roger Ackroyd\u0027, ch 1\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"She died of an overdose of \u0027\u0027veronal\u0027\u0027. She\u0027s been taking it lately for sleeplessness. Must have taken too much\", \"priority\":5}]}, \"synonyms\":{}}");

	add("veronica", "{\"term\":\"veronica\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Named after {{w|Saint Veronica}}.{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The image of Jesus\u0027s face believed to have been made on the cloth with which St Veronica wiped his face as he went to be crucified; or the cloth used for this\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1973\u0027\u0027, Nicholas Monsarrat, \u0027The Kapillan of Malta\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A veil that had wiped off the sweat of Christ? Who could possibly believe that? (…) The only true \u0027\u0027Veronica\u0027\u0027 of this century was the \u0027veronica\u0027 of the matador – the classic slow swing of the cape before the bull’s face, imitating that holy wiping, mocking it\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1988\u0027\u0027, Anthony Burgess, \u0027Any Old Iron\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"He wiped the lady’s martini glass, having had some trouble with a kind of \u0027\u0027veronica\u0027\u0027 of lipstick, spat in it viciously, then washed it again\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A circular swinging movement of the cape, used to avoid the bull\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1973\u0027\u0027, Thomas Pynchon, \u0027Gravity\u0027s Rainbow\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The cougher makes a lunge. Slothrop sweeps aside, gives him a quick \u0027\u0027veronica\u0027\u0027 with his cape, sticks his foot out and trips the kid, who lies on the ground cursin\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1989\u0027\u0027, Martin Amis, \u0027London Fields\u0027, Vintage 2003, p. 357\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"He stepped aside as a fight got going between an attendant and some kid by the Alkool display, hopping backwards in a practised \u0027\u0027veronica\u0027\u0027 when a bottle broke, fearful for his flares\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A flower of the genus \u0027Veronica\u0027, usually having blue petals\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Thomas Pynchon, \u0027Against the Day\u0027, Vintage 2007, p. 871\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"meadows full of wildflowers that seemed to Kit enormous, violets as big as your hand, yellow lilies and blue \u0027\u0027veronica\u0027\u0027 you could shelter from the rain unde\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"1978\u0027\u0027, Iris Murdoch, \u0027The Sea, The Sea\u0027, Vintage 1999, p. 11\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"There are also (placed there by man or nature?) quite a lot of skinny fuchsias and dense \u0027\u0027veronicas\u0027\u0027, all in flower, and some kind of rather attractive grey-leaved sage\", \"priority\":15}]}, \"synonyms\":{}}");

