	add("verruca", "{\"term\":\"verruca\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027verrūca\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A wart, especially one that grows on the foot, caused by a\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A rounded projection or wart\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A sexine element similar to a wart\", \"priority\":3}]}, \"synonyms\":{}}");

	add("verso", "{\"term\":\"verso\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027in\u0027 \u0027versō\u0027 \u0027foliō\u0027 (on the turned leaf, on the turned page) the ablative of the Latin \u0027versus\u0027 (turned, changed) from the perfect passive participle of \u0027vertō\u0027 (turn) Compare \u0027rēctus\u0027 (right)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The back side of a flat object which is to be examined visually, as for reading, such as a sheet or a leaf or a coin or a medal\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The left-hand page of a book of a script which reads from left to right, usually having an even page number\", \"priority\":2}]}, \"synonyms\":{}}");

	add("verst", "{\"term\":\"verst\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\", \"French\"], \"text\":\"{{borrowing|ru|верста́|lang\u003den}}, partly through German {{m|de|Werst}} and French {{m|fr|verste}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A Russian unit of length, equivalent to about 1.07 kilometres or about 2/3 of a mile\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1849\u0027\u0027, \u0026quot;The Observatory at Pulkowa\u0026quot; The North American Review Volume 0069 Issue 144 (July 1849\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"lang\u003den\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1910\u0027\u0027, \u0026quot;Reginald in Russia\u0026quot;, \u0027Reginald in Russia\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1918\u0027\u0027, trans. Leo Tolstoy, \u0027Anna Karenina\u0027, Oxford 1998, p. 604\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1988\u0027\u0027, \u0027Any Old Iron\", \"priority\":6}]}, \"synonyms\":{}}");

	add("versailles", "{\"term\":\"versailles\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French {{m|fr|Versailles}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A suburb of Paris, formerly the capital of France\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The w:Palace of Palace of Versailles\", \"priority\":2}]}, \"synonyms\":{}}");

	add("versatility", "{\"term\":\"versatility\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|versatile|ity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The property of being versatile or having many different abilities; flexibility\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1749,\u0027\u0027 Philip Dormer Stanhope, Earl of Chesterfield, \u0027Letters to His Son 1749\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Those are the sort of women who polish a young man the most, and who give him that habit of complaisance, and that flexibility and \u0027\u0027versatility\u0027\u0027 of manners which prove of great use to him with men, and in the course of business\", \"priority\":3}]}, \"synonyms\":{}}");

	add("versemonger", "{\"term\":\"versemonger\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|verse|monger|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A writer of verses or of commonplace poetry\", \"priority\":1}]}, \"synonyms\":{}}");

