	add("versificator", "{\"term\":\"versificator\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027versificator\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who writes verse; a poet\", \"priority\":1}]}, \"synonyms\":{}}");

	add("version", "{\"term\":\"version\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"{{PIE root|en|wert}}From Middle french (ca. 1400-1600) \u0027version\u0027 () from \u0027versiō\u0027 (lang\u003dla) from Latin \u0027vertō\u0027 (lang\u003dla) Used in English since 16th century.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A specific form or variation of something\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d3|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003d‘[…]\u0026amp;nbsp;There\u0027s every Staffordshire crime-piece ever made in this cabinet, and that\u0027s unique. The Van Hoyer Museum in New York hasn\u0027t that very rare second \u0027\u0027version\u0027\u0027 of Maria Marten\u0027s Red Barn over there, nor the little Frederick George Manning—he was the criminal Dickens saw hanged on the roof of the gaol in Horsemonger Lane, by the way—’\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dAn extreme \u0027\u0027version\u0027\u0027 of vorticity is a \u0027vortex\u0027. The vortex is a spinning, cyclonic mass of fluid, which can be observed in the rotation of water going down a drain, as well as in smoke rings, tornados and hurricanes\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A translation from one language to another\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The act of translating, or rendering, from one language into another language\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An account or description from a particular point of view, especially as contrasted with another account\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A particular revision (of software, firmware, CPU, etc\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A condition of the uterus in which its axis is deflected from its normal position without being bent upon itself. See anteversion and retroversion\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"An eye movement involving both eyes moving synchronously and symmetrically in the same direction\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A change of form, direction, etc.; transformation; conversion\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Francis Baco\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027version\u0027\u0027 of air into water\", \"priority\":12}]}, \"synonyms\":{}}");

	add("versioning", "{\"term\":\"versioning\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|version|ing|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The use of versions as a means of distinguishing similar items\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027, Stefano Ceri, Katsumi Tanaka, Shalom Tsur, \u0027Deductive and Object-oriented Databases\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"There have been many proposals to incorporate \u0027\u0027versioning\u0027\u0027 in object-oriented databases\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Longley \u0027et al\u0027, \u0027Geographic Information Systems and Science\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An alternative to pessimistic locking is optimistic \u0027\u0027versioning\", \"priority\":5}]}, \"synonyms\":{}}");

	add("versionitis", "{\"term\":\"versionitis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|version|itis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A situation in which there are many different (and possibly incompatible) versions of the same software, file or document.\u0026lt;ref\u0026gt;http://en.wikipedia.org/wiki/Honeypot_(computing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Detection\u0026lt;/ref\u0026gt;\u0026lt;ref\u0026gt;http://libreofficeaustralia.org/lt/community/blog/planet/20110406/versionitis\u0026lt;/ref\u0026gt;\u0026lt;ref\u0026gt;http://www.komando.com/downloads/category.aspx?id\u003d9606\u0026amp;page\u003d2\u0026lt;/ref\u0026gt;\u0026lt;ref\u0026gt;http://fppad.com/2008/02/11/suffering-from-versionitis\u0026lt;/ref\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1992\u0027\u0027, \u0027InfoWorld\u0027 (volume 14, number 33, page 92\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"This helps companies maintain an honest relationship with the software publisher and protects against \u0027\u0027versionitis\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Joel Henry, \u0027Software project management: a real-world guide to success\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Versionitis\u0027\u0027 exists when the team is using multiple versions of the same software Integration of modules can be a nightmare when a project catches versionitis\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Bud E. Smith, Michael McCallister, \u0027WordPress in depth\u0027 (page 455\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The Handbook can suffer from \u0027\u0027versionitis\u0027\u0027; at this writing, the Handbook is one release behind the current version of the software, making it out of date in parts\", \"priority\":8}]}, \"synonyms\":{}}");

	add("verstehen", "{\"term\":\"verstehen\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\"], \"text\":\"German\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A stance that attempts to understand the meaning of action from the actor\u0027s point of view, so that the actor is seen as a subject rather than an object of observation\", \"priority\":1}]}, \"synonyms\":{}}");

	add("vertu", "{\"term\":\"vertu\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\", \"Italian\", \"Latin\"], \"text\":\"From Italian \u0027virtù, †vertù\u0027 (moral worth, virtue (13th century); determination, perseverance, military valour (14th century); study of the liberal or fine arts; appreciation of, taste for, or expertise in the fine arts; objets d\u0027art collectively (16th century)) or from French \u0027vertu\u0027 (virtue) ultimately from Latin \u0027virtūt-, virtus\u0027 (virtue)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Especially in the writings of Machiavelli (1469–1527): excellence; moral virtue; honor; power\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1976\u0027\u0027, ; James B. Atkinson, transl., \u0027\u0027 [The Library of Liberal Arts; LLA-172], Indianapolis, Ind.: , ISBN 978-0-672-51542-2; reprinted as Indianapolis, Ind.: , 2008, ISBN 978-0-87220-920-6, pages 69–70\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"All these connotations, even the positive and moral ones, are within the range of significations Machiavelli wants us to hear in “\u0027\u0027\u0027virtù\u0027\u0027\u0027.” For him the word suggests a kind of flexibility that can initiate effective, efficient, and energetic action based on a courageous assertion of the will and an ability to execute the products of one\u0027s own calculations. Such calculations are a significant adjunct to his ideas about \u0027\u0027\u0027virtù\u0027\u0027\u0027: they outline what might be called an internal or mental \u0027\u0027\u0027virtù\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"pages\u003d6–7|isbn\u003d978-0-226-50368-4|passage\u003dWhat is one to make of this? Machiavelli seems to deplore the need for a prince to be evil, and in the next breath to relish the fact. He alternately shocks his readers and provides relief from the very shocks he administers: Agathocles has \u0027\u0027\u0027virtù\u0027\u0027\u0027 but cannot be said to have \u0027\u0027\u0027virtù\u0027\u0027\u0027. It is not enough to say that he uses the word in several “senses”; he uses it in two contradictory senses as to whether it includes or excludes evil deeds\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"page\u003d175|isbn\u003d978-0-521-59752-4|passage\u003dHonor and glory are for w:Niccolò [Niccolò] Machiavelli closely tied to \u0027\u0027\u0027virtù\u0027\u0027\u0027, \u0026quot;virtue.\u0026quot; The Latin \u0027virtus\u0027, from which the Tuscan/Italian term is derived, has its root in \u0027vir\u0027, man. \u0027\u0027\u0027Virtù\u0027\u0027\u0027 refers to those things especially characteristic of man, the qualities that make us human. To oversimplify, Machiavelli uses \u0027virtù\u0027 to refer both to “Christian” moral virtues, the conventional universalistic values embodied in the Golden Rule, and to a set of more particularistic classical virtues centered on honor. Together they comprise Machiavelli\u0027s account of the most noble and distinctive human excellences, achievements, and aspirations\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Knowledge of the fine arts\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"T]hoſe young Gentlemen of our Times, who have the ſame Ambition to be diſtinguiſhed for Parts. Wit certainly they have nothing to do with. To give them their Due, they ſoar a Step higher than their Predeceſſors, and may be called Men of Wiſdom and \u0027\u0027Vertù\u0027\u0027 (take heed you do not read Virtue\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"objet Objets d\u0027art collectively\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1851\u0027\u0027, Moby-Dick, or, The Whale\u0027, New York, N.Y.: w:Harper Harper \u0026amp; Brothers; London: w:Richard Bentley Richard Bentley, [http://www.worldcat.org/oclc/30847311 30847311]; republished as \u0027Moby-Dick or The White Whale\u0027\u0026lt;sup\u0026gt;[https://books.google.com/books?id\u003dXV8XAAAAYAAJ\u0026amp;pg\u003dPA423]\u0026lt;/sup\u0026gt;, Boston: The St. Botolph Society, 1922, [http://www.worldcat.org/oclc/237074 237074], page 423\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Now, when with royal Tranquo I visited this wondrous whale, and saw the skull an altar, and the artificial smoke ascending from where the real jet had issued, I marvelled that the king should regard a chapel as an object of \u0027\u0027vertù\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"location\u003dLondon|publisher\u003d|year\u003d1852|page\u003d178|oclc\u003d700886567|passage\u003dThe more drawers and closets there were, the more hiding-holes could Charlotte make for the accommodation of old rags, hair-combs, old shoes, ribbons, cast-off artificial flowers, and other articles of \u0027\u0027\u0027vertù\u0027\u0027\u0027, wherein her soul delighted\", \"priority\":11}]}, \"synonyms\":{}}");

	add("vertebra", "{\"term\":\"vertebra\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027vertebra\u0027 (joint) from \u0027vertere\u0027 (to turn) Having multiple vertebrae (plural of vertebra) in one\u0027s backbone instead of having a single bone or solid spine, allows for the movement of the body with bends and turns. Hence meaning 1.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of the small bones which make up the backbone\", \"priority\":1}]}, \"synonyms\":{\"list\":[{\"text\":\"spondyle\", \"synonymQualifier\":\"RARE\"}]}}");

