	add("vertigo", "{\"term\":\"vertigo\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027vertīgō\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sensation of whirling and loss of balance, caused by looking down from a great height or by disease affecting the inner ear\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A disordered or imbalanced state of mind or things analogous to physical vertigo; mental giddiness or dizziness\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The act of whirling round and round; rapid rotation\", \"priority\":3}]}, \"synonyms\":{}}");

